import React, { Component } from 'react'

class Customers extends Component {
    render() {
        return(
            <div className="container">
            <div className="col-md-6">
                <ul>
                    {
                        this.props.users.map((user, i) => 
                          <li key={user.id}>
                              <p>{user.first}</p>
                              <p>{user.email}</p>
                          </li>
                          )
                    }
                </ul>
            </div>
            <div className="col-md-6">
                <ul>
                    {
                        this.props.rides.map((ride, i) =>
                         <li key={ride.id}>
                             <p>{ride.pickup}</p>
                             <p>{ride.dropOff}</p>
                         </li>
                         )
                    }
                </ul>
            </div>
        </div>
        )
    }
}

export default Customers;
